$(document).ready(function(){var e=$("#tweets"),t=e.data("twitter-username");$.getJSON("/tweets/"+t+"/",function(t){for(num=t.length-1;num>=0;num--){tweet=t[num];e.prepend('<li class="style-'+(num%3+1)+'"><div class=" text">'+tweet.text_urlized_atlinked+'</div><div class="created_at"><a href="http://twitter.com/#!/'+tweet.user.screen_name+"/status/"+tweet.id_str+'">'+tweet.created_timesince+"</a></div></li>")}})});